drop table TAX_TYPE cascade constraint;
drop table TAX_PAYER cascade constraint;
drop table PERSON cascade constraint;
drop table COMPANY cascade constraint;
drop table PHONE_NUMBER_COMPANY cascade constraint;
drop table PHONE_NUMBER_PERSON cascade constraint;
drop table PHONE_TYPE cascade constraint;
drop table COMPANY_OWNER cascade constraint;
drop table AGENCY cascade constraint;
drop table TAX_PAYMENT cascade constraint;

-- SEQ
drop SEQUENCE TAX_TYPE_SEQ;
drop SEQUENCE PHONE_TYPE_SEQ;
drop SEQUENCE PERSON_SEQ;
drop SEQUENCE PHONE_NUMBER_COMPANY_SEQ;
drop SEQUENCE PHONE_NUMBER_PERSON_SEQ;
drop SEQUENCE TAX_PAYER_SEQ;
drop SEQUENCE COMPANY_SEQ;

Create table TAX_TYPE (
	id_tax_type Integer NOT NULL ,
	name Varchar2 (60) NOT NULL ,
primary key (id_tax_type) 
) 
/

Create table PERSON (
	doc_number Varchar2 (60) NOT NULL ,
	name Varchar2 (60) NOT NULL ,
	surname Varchar2 (60) NOT NULL ,
	birth_date Date NOT NULL ,
	home_address Varchar2 (60) NOT NULL ,
	email Varchar2 (60) NOT NULL ,
primary key (doc_number) 
) 
/

Create table COMPANY (
	cuit Varchar2 (60) NOT NULL ,
	name Varchar2 (60) NOT NULL ,
	commencement_date Date NOT NULL ,
	web Varchar2 (60) NOT NULL ,
	email Varchar2 (60) NOT NULL ,
primary key (cuit) 
) 
/

Create table COMPANY_OWNER (
	doc_number Varchar2 (60) NOT NULL ,
	cuit Varchar2 (60) NOT NULL,
primary key (doc_number,cuit) 
) 
/

Create table PHONE_TYPE (
	id_phone_type Integer NOT NULL ,
	name Varchar2 (60) NOT NULL ,
primary key (id_phone_type) 
) 
/

Create table PHONE_NUMBER_COMPANY (
	id Integer NOT NULL ,
	id_phone_type Integer NOT NULL ,
	cuit Varchar2 (60) NOT NULL ,
	number_value Varchar2 (60) NOT NULL ,
primary key (id,id_phone_type,cuit) 
) 
/

Create table PHONE_NUMBER_PERSON (
	id Integer NOT NULL ,
	doc_number Varchar2 (60) NOT NULL ,
	id_phone_type Integer NOT NULL ,
	number_value Varchar2 (60) NOT NULL ,
primary key (id,doc_number,id_phone_type) 
) 
/

Create table AGENCY (
	id_agency_number Integer NOT NULL ,
	id_charge_person Varchar2 (60) NOT NULL ,
	address Varchar2 (60) NOT NULL ,
	employees_number Varchar2 (60) NOT NULL ,
primary key (id_agency_number) 
) 
/

Create table TAX_PAYMENT (
	payment_date Date NOT NULL ,
	id_agency_number Integer NOT NULL ,
	id_tax_type Integer NOT NULL ,
	id_tax_payer Integer NOT NULL ,
	amount Real NOT NULL ,
primary key (payment_date,id_agency_number,id_tax_type,id_tax_payer) 
) 
/

Create table TAX_PAYER (
	id_tax_payer Integer NOT NULL ,
	cuit Varchar2 (60) UNIQUE,
	doc_number Varchar2 (60) UNIQUE,
  CONSTRAINT xor CHECK((cuit is null AND doc_number is not null)OR(cuit is not null AND doc_number is null)),
primary key (id_tax_payer)
) 
/

Alter table TAX_PAYMENT add  foreign key (id_tax_type) references TAX_TYPE (id_tax_type) 
/
Alter table COMPANY_OWNER add  foreign key (doc_number) references PERSON (doc_number) 
/
Alter table PHONE_NUMBER_PERSON add  foreign key (doc_number) references PERSON (doc_number) 
/
Alter table AGENCY add  foreign key (id_charge_person) references PERSON (doc_number) 
/
Alter table TAX_PAYER add  foreign key (doc_number) references PERSON (doc_number) 
/
Alter table COMPANY_OWNER add  foreign key (cuit) references COMPANY (cuit) 
/
Alter table PHONE_NUMBER_COMPANY add  foreign key (cuit) references COMPANY (cuit) 
/
Alter table TAX_PAYER add  foreign key (cuit) references COMPANY (cuit) 
/
Alter table PHONE_NUMBER_COMPANY add  foreign key (id_phone_type) references PHONE_TYPE (id_phone_type) 
/
Alter table PHONE_NUMBER_PERSON add  foreign key (id_phone_type) references PHONE_TYPE (id_phone_type) 
/
Alter table TAX_PAYMENT add  foreign key (id_agency_number) references AGENCY (id_agency_number) 
/
Alter table TAX_PAYMENT add  foreign key (id_tax_payer) references TAX_PAYER (id_tax_payer) 
/

