CREATE SEQUENCE TAX_TYPE_SEQ
  MINVALUE 1
  START WITH 1
  INCREMENT BY 1
  CACHE 20;
/

CREATE SEQUENCE PHONE_TYPE_SEQ
  MINVALUE 1
  START WITH 1
  INCREMENT BY 1
  CACHE 20;
/

CREATE SEQUENCE PERSON_SEQ
