  INCREMENT BY 1
  CACHE 20;
/

CREATE SEQUENCE COMPANY_SEQ
  MINVALUE 1
  START WITH 1
  INCREMENT BY 1
  CACHE 20;
/

CREATE SEQUENCE PHONE_NUMBER_COMPANY_SEQ
  MINVALUE 1
  START WITH 1
  INCREMENT BY 1
  CACHE 100;
/

CREATE SEQUENCE PHONE_NUMBER_PERSON_SEQ
  MINVALUE 1
  START WITH 1
  INCREMENT BY 1
  CACHE 100;
/

