-- ------------------------------------------------------------------------
-- how to insert 100 person as taxpayers
-- each ODD
-- ------------------------------------------------------------------------
select TAX_PAYER_SEQ.NEXTVAL, NULL, doc_number
  from (
        select doc_number, null from person
        where mod(person.DOC_NUMBER,2)=0
       ) derived;
       
-- COMPANIES
-- --------------------------------------------------------
-- insert for 100 companies
-- ---------------------------------------------------------

-- ------------------------------------------------------------------------
-- how to insert 100 COMPANIES as taxpayer
-- each EVEN
-- ------------------------------------------------------------------------
select TAX_PAYER_SEQ.NEXTVAL,CUIT, null
  from (
        select cuit, null from COMPANY
        where mod(COMPANY.CUIT,2)!=0
       ) derived;


